import React, {Component} from 'react';
import {BrowserRouter, Route} from "react-router-dom";
import bottomNavBar from '../Components/bottomNavBar';

class Home extends Component {
    render () {
        return (
            <BrowserRouter>
                <div className="homeBlock">
                    <h1>HOME</h1>

                    <div className="map">
                        <bottomNavBar/>
                    </div>

                </div>
            </BrowserRouter>
        );
    }
};

export default Home;
